import React from "react";
import Table from "./Table";
import {LinearProgress} from "@material-ui/core";

export default function MainWindow(props) {

const colorStyle = {
    primary: 'red',
}

  const title = props.title,
    items = props.items;

  if (items) {
    return (
      <section>
        <h2>{title}</h2>
        
        <div className="items_list">
          {items.map((item, key) => (
            <Table
              favorite_likes={props.favorit_likes}
              item={item}
              key={key}
              like={(like_data, id) => {
                props.like(like_data, id);
              }}
            />
          ))}
        </div>
      </section>
    );
  } else {
    return (
      <section>
        <div className="linear_progress">
          <LinearProgress colorPrimary={colorStyle.primary}/>
        </div>
      </section>
    );
  }
}
